function initCard23(s){if(!s.classList.contains("initialized")){s.classList.add("initialized");let t=s.querySelector(".btn--reset"),i=s.querySelector(".overlay");var e=s.querySelector(".top.small");t.addEventListener("click",function(e){s.focus(),t.tabIndex="-1",s.classList.add("reset"),s.offsetHeight,s.classList.remove("reset"),t.classList.remove("active"),i.classList.remove("active")}),e.addEventListener("animationend",()=>{t.tabIndex="0",t.classList.add("active"),i.classList.add("active")})}}export{initCard23};